import {put} from 'redux-saga/effects';
import axios from 'axios';

import * as actions from '../actions/search';


export function* getProps() {
    try {
        const resp = yield axios.get('https://react-poc-6909c.firebaseio.com/listings.json');

        yield put(actions.getProperties(resp.data))
    } catch(err) {
        console.log(err)
    }
}
